    K(:,:,n)=  (0.3/Ts)*inv(C*B(:,:,n));
   
    
    e = yd - x2;
    ek1 = e(:,2:n);
    ek1(:,n) = e(:,n);
    for i=1:n
     u(:,i)=  u(:,i) + K(:,:,i)*ek1(:,i); 
        
    end
    
    
    
    count = count + 1;
    maxabse1(count) = max(abs(ek1(1,:)));
    maxabse2(count) = max(abs(ek1(2,:)));
    maxabse3(count) = max(abs(ek1(3,:)));
